import React from "react";

function Footer() {
  return (
    <div className="one">
      <footer class="two">
        <div class="three">
          <p class="four">
            IoTECS - IoT based Emergency Communication System
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
